import React from 'react'
import { Avatar } from "@material-ui/core"

function Headeroptions({Icon,title,avatar}) {
  return (
    <div className='header__options'>
      {
        Icon && <Icon></Icon>
      }
      { 
        avatar && <Avatar name = {avatar}/>
      }
      <Icon></Icon>
      <span>{title}</span>
    </div>
  )
}

export default Headeroptions;
